script: |
  super -f text -I q5399.spq | sort > q5399.out

inputs:
  - name: q5399.spq
    data: |
      SELECT DISTINCT - col0 * + + col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( + col2 * col0, 51, + 59, - 90, - - col1 / 26 / - col1 );
  - name: tab2

outputs:
  - name: q5399.out
    data: |
